import './styles/App.scss';
import Navbar from './navbar';
import AboutUs from './aboutUs';
import Membership from './membership';
import 'bootstrap/dist/css/bootstrap.min.css';
import { FaAngleUp } from 'react-icons/fa';

function App() {  
    return ( 
    <div className = "App" >
      <Navbar />
      <AboutUs />
      <Membership />
      <button tyle={topButton}><a href="#top" style={topButton}><FaAngleUp style={arrowUp}/></a></button>
    </div>  
    );
}

const topButton = {
  backgroundColor: "none !important",
  color: "none",
  border: "none"
}

const arrowUp = {
  color: "#FFF",
  backgroundColor: "#989898",
  height: 50 + "px",
  width: 50 + "px",
  borderRadius: 200 + "px"
}

export default App;
